export const FaqBody = () => {
  return (
    <div style={{ backgroundColor: colors.lightPink, height: "100vh" }}>
      <Image
        src={require("/home/shawen/Code/faq-accordion/accordion/public/assets/images/background-pattern-desktop.svg")}
      />
      <Footer />
    </div>
  );
};
